import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

function RatingCard(props) {
  return (
    <article className="testimonial-card">
      <h3>
        {props.rating}/5.0

      </h3>
      <div>
        <img src={props.imageURL} />
        <p>
          <b>{props.name}</b>
        </p>
      </div>
      <p>{props.text}</p>
    </article>
  );
}

export default RatingCard;
